INSERT INTO `dim_product` (`productCode`, `productName`, `productLine`, `productVendor`, `quantityInStock`, `productDescription`) VALUES
('S10_1678', '1969 Harley Davidson Ultimate Chopper', 'Motorcycles', 'Min Lin Diecast', 7933, 'This replica features working kickstand, front suspension, gear-shift lever, footbrake lever, drive chain, wheels and steering. All parts are particularly delicate due to their precise scale and require special care and attention.'),
('S10_1949', '1952 Alpine Renault 1300', 'Classic Cars', 'Classic Metal Creations', 7305, 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
('S10_2016', '1996 Moto Guzzi 1100i', 'Motorcycles', 'Highway 66 Mini Classics', 6625, 'Official Moto Guzzi logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.'),
('S10_4698', '2003 Harley-Davidson Eagle Drag Bike', 'Motorcycles', 'Red Start Diecast', 5582, 'Model features, official Harley Davidson logos and insignias, detachable rear wheelie bar, heavy diecast metal with resin parts, authentic multi-color tampo-printed graphics, separate engine drive belts, free-turning front fork, rotating tires and rear racing slick, certificate of authenticity, detailed engine, display stand\r\n, precision diecast replica, baked enamel finish, 1:10 scale model, removable fender, seat and tank cover piece for displaying the superior detail of the v-twin engine'),
('S10_4757', '1972 Alfa Romeo GTA', 'Classic Cars', 'Motor City Art Classics', 3252, 'Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
('S10_4962', '1962 LanciaA Delta 16V', 'Classic Cars', 'Second Gear Diecast', 6791, 'Features include: Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
('S12_1099', '1968 Ford Mustang', 'Classic Cars', 'Autoart Studio Design', 68, 'Hood, doors and trunk all open to reveal highly detailed interior features. Steering wheel actually turns the front wheels. Color dark green.'),
('S12_1108', '2001 Ferrari Enzo', 'Classic Cars', 'Second Gear Diecast', 3619, 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
('S12_1666', '1958 Setra Bus', 'Trucks and Buses', 'Welly Diecast Productions', 1579, 'Model features 30 windows, skylights & glare resistant glass, working steering system, original logos'),
('S12_2823', '2002 Suzuki XREO', 'Motorcycles', 'Unimax Art Galleries', 9997, 'Official logos and insignias, saddle bags located on side of motorcycle, detailed engine, working steering, working suspension, two leather seats, luggage rack, dual exhaust pipes, small saddle bag located on handle bars, two-tone paint with chrome accents, superior die-cast detail , rotating wheels , working kick stand, diecast metal with plastic parts and baked enamel finish.'),
('S12_3148', '1969 Corvair Monza', 'Classic Cars', 'Welly Diecast Productions', 6906, '1:18 scale die-cast about 10\" long doors open, hood opens, trunk opens and wheels roll'),
('S12_3380', '1968 Dodge Charger', 'Classic Cars', 'Welly Diecast Productions', 9123, '1:12 scale model of a 1968 Dodge Charger. Hood, doors and trunk all open to reveal highly detailed interior features. Steering wheel actually turns the front wheels. Color black'),
('S12_3891', '1969 Ford Falcon', 'Classic Cars', 'Second Gear Diecast', 1049, 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
('S12_3990', '1970 Plymouth Hemi Cuda', 'Classic Cars', 'Studio M Art Models', 5663, 'Very detailed 1970 Plymouth Cuda model in 1:12 scale. The Cuda is generally accepted as one of the fastest original muscle cars from the 1970s. This model is a reproduction of one of the orginal 652 cars built in 1970. Red color.'),
('S12_4473', '1957 Chevy Pickup', 'Trucks and Buses', 'Exoto Designs', 6125, '1:12 scale die-cast about 20\" long Hood opens, Rubber wheels'),
('S12_4675', '1969 Dodge Charger', 'Classic Cars', 'Welly Diecast Productions', 7323, 'Detailed model of the 1969 Dodge Charger. This model includes finely detailed interior and exterior features. Painted in red and white.'),
('S18_1097', '1940 Ford Pickup Truck', 'Trucks and Buses', 'Studio M Art Models', 2613, 'This model features soft rubber tires, working steering, rubber mud guards, authentic Ford logos, detailed undercarriage, opening doors and hood,  removable split rear gate, full size spare mounted in bed, detailed interior with opening glove box'),
('S18_1129', '1993 Mazda RX-7', 'Classic Cars', 'Highway 66 Mini Classics', 3975, 'This model features, opening hood, opening doors, detailed engine, rear spoiler, opening trunk, working steering, tinted windows, baked enamel finish. Color red.'),
('S18_1342', '1937 Lincoln Berline', 'Vintage Cars', 'Motor City Art Classics', 8693, 'Features opening engine cover, doors, trunk, and fuel filler cap. Color black'),
('S18_1367', '1936 Mercedes-Benz 500K Special Roadster', 'Vintage Cars', 'Studio M Art Models', 8635, 'This 1:18 scale replica is constructed of heavy die-cast metal and has all the features of the original: working doors and rumble seat, independent spring suspension, detailed interior, working steering system, and a bifold hood that reveals an engine so accurate that it even includes the wiring. All this is topped off with a baked enamel finish. Color white.'),
('S18_1589', '1965 Aston Martin DB5', 'Classic Cars', 'Classic Metal Creations', 9042, 'Die-cast model of the silver 1965 Aston Martin DB5 in silver. This model includes full wire wheels and doors that open with fully detailed passenger compartment. In 1:18 scale, this model measures approximately 10 inches/20 cm long.'),
('S18_1662', '1980s Black Hawk Helicopter', 'Planes', 'Red Start Diecast', 5330, '1:18 scale replica of actual Army\'s UH-60L BLACK HAWK Helicopter. 100% hand-assembled. Features rotating rotor blades, propeller blades and rubber wheels.'),
('S18_1749', '1917 Grand Touring Sedan', 'Vintage Cars', 'Welly Diecast Productions', 2724, 'This 1:18 scale replica of the 1917 Grand Touring car has all the features you would expect from museum quality reproductions: all four doors and bi-fold hood opening, detailed engine and instrument panel, chrome-look trim, and tufted upholstery, all topped off with a factory baked-enamel finish.'),
('S18_1889', '1948 Porsche 356-A Roadster', 'Classic Cars', 'Gearbox Collectibles', 8826, 'This precision die-cast replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
('S18_1984', '1995 Honda Civic', 'Classic Cars', 'Min Lin Diecast', 9772, 'This model features, opening hood, opening doors, detailed engine, rear spoiler, opening trunk, working steering, tinted windows, baked enamel finish. Color yellow.'),
('S18_2238', '1998 Chrysler Plymouth Prowler', 'Classic Cars', 'Gearbox Collectibles', 4724, 'Turnable front wheels; steering function; detailed interior; detailed engine; opening hood; opening trunk; opening doors; and detailed chassis.'),
('S18_2248', '1911 Ford Town Car', 'Vintage Cars', 'Motor City Art Classics', 540, 'Features opening hood, opening doors, opening trunk, wide white wall tires, front door arm rests, working steering system.'),
('S18_2319', '1964 Mercedes Tour Bus', 'Trucks and Buses', 'Unimax Art Galleries', 8258, 'Exact replica. 100+ parts. working steering system, original logos'),
('S18_2325', '1932 Model A Ford J-Coupe', 'Vintage Cars', 'Autoart Studio Design', 9354, 'This model features grille-mounted chrome horn, lift-up louvered hood, fold-down rumble seat, working steering system, chrome-covered spare, opening doors, detailed and wired engine'),
('S18_2432', '1926 Ford Fire Engine', 'Trucks and Buses', 'Carousel DieCast Legends', 2018, 'Gleaming red handsome appearance. Everything is here the fire hoses, ladder, axes, bells, lanterns, ready to fight any inferno.'),
('S18_2581', 'P-51-D Mustang', 'Planes', 'Gearbox Collectibles', 992, 'Has retractable wheels and comes with a stand'),
('S18_2625', '1936 Harley Davidson El Knucklehead', 'Motorcycles', 'Welly Diecast Productions', 4357, 'Intricately detailed with chrome accents and trim, official die-struck logos and baked enamel finish.'),
('S18_2795', '1928 Mercedes-Benz SSK', 'Vintage Cars', 'Gearbox Collectibles', 548, 'This 1:18 replica features grille-mounted chrome horn, lift-up louvered hood, fold-down rumble seat, working steering system, chrome-covered spare, opening doors, detailed and wired engine. Color black.'),
('S18_2870', '1999 Indy 500 Monte Carlo SS', 'Classic Cars', 'Red Start Diecast', 8164, 'Features include opening and closing doors. Color: Red'),
('S18_2949', '1913 Ford Model T Speedster', 'Vintage Cars', 'Carousel DieCast Legends', 4189, 'This 250 part reproduction includes moving handbrakes, clutch, throttle and foot pedals, squeezable horn, detailed wired engine, removable water, gas, and oil cans, pivoting monocle windshield, all topped with a baked enamel red finish. Each replica comes with an Owners Title and Certificate of Authenticity. Color red.'),
('S18_2957', '1934 Ford V8 Coupe', 'Vintage Cars', 'Min Lin Diecast', 5649, 'Chrome Trim, Chrome Grille, Opening Hood, Opening Doors, Opening Trunk, Detailed Engine, Working Steering System'),
('S18_3029', '1999 Yamaha Speed Boat', 'Ships', 'Min Lin Diecast', 4259, 'Exact replica. Wood and Metal. Many extras including rigging, long boats, pilot house, anchors, etc. Comes with three masts, all square-rigged.'),
('S18_3136', '18th Century Vintage Horse Carriage', 'Vintage Cars', 'Red Start Diecast', 5992, 'Hand crafted diecast-like metal horse carriage is re-created in about 1:18 scale of antique horse carriage. This antique style metal Stagecoach is all hand-assembled with many different parts.\r\n\r\nThis collectible metal horse carriage is painted in classic Red, and features turning steering wheel and is entirely hand-finished.'),
('S18_3140', '1903 Ford Model A', 'Vintage Cars', 'Unimax Art Galleries', 3913, 'Features opening trunk,  working steering system'),
('S18_3232', '1992 Ferrari 360 Spider red', 'Classic Cars', 'Unimax Art Galleries', 8347, 'his replica features opening doors, superb detail and craftsmanship, working steering system, opening forward compartment, opening rear trunk with removable spare, 4 wheel independent spring suspension as well as factory baked enamel finish.'),
('S18_3233', '1985 Toyota Supra', 'Classic Cars', 'Highway 66 Mini Classics', 7733, 'This model features soft rubber tires, working steering, rubber mud guards, authentic Ford logos, detailed undercarriage, opening doors and hood, removable split rear gate, full size spare mounted in bed, detailed interior with opening glove box'),
('S18_3259', 'Collectable Wooden Train', 'Trains', 'Carousel DieCast Legends', 6450, 'Hand crafted wooden toy train set is in about 1:18 scale, 25 inches in total length including 2 additional carts, of actual vintage train. This antique style wooden toy train model set is all hand-assembled with 100% wood.'),
